INSERT INTO `block_custom` VALUES (1,' <?php\r\n  $node = node_load(4);\r\n  $submission = webform_get_submission(\'4\', \'27\');\r\n  webform_node_view($node,\'full\');\r\n  $o = theme_webform_view($node->content);\r\n  print($o);\r\n?>','Webform block','php_code'),(2,'<div class=\"graphics-uwt_w_and_wordmark_horiz_white\"></div>','UWT Logo','full_html'),(3,'The Time of Emergence project is a product of the University of Washington Climate Impacts Group. Website and database design by University of Washington (Tacoma) Center for Data Sciences. This project is supported by U.S. Environmental Protection Agency Region 10 and the U.S. Army Corps of Engineers.','ACKNOWLEDGMENTS','filtered_html'),(4,'The data and maps in this tool illustrate the potential effects of climate change, not the exact location nor timing. The data, maps, and information are provided for informational purposes only, and should be used only for screening or reference purposes. This tool shall not be used to assess actual hazards, insurance requirements, property values, permitting, or other legal purposes. Any opinions, findings, conclusions expressed in this project are those of the Climate Impacts Group and do not necessarily reflect the views of the USEPA or USACE. The entire risk associated with the results and performance of these data is assumed by the user.','DISCLAIMER','filtered_html'),(5,'&nbsp;','Empty Footer 2 placeholder','full_html'),(6,'<p>This map provides an indication of the priority areas in the Pacific Northwest based on the selected hydro-climatic variables for different decades. The darker the shading, the higher the fraction of selected hydro-climatic variables showing emergence of the climate change signal (i.e. noticeable effects of climate change) by a particular decade.</p>\r\n\r\n<p>View the <a href=\"/timeline\">Timeline visualization</a> for this set of variables and parameters.</p>\r\n','Density Maps top text','filtered_html');
