 around form choices? YES, but the theme supresses fieldset borders. Moving border work to Anika. - DONE \r\n--more move all to top of list. - DONE \r\nMake variable box bigger. Label it as \'Hydroclimatic Variables\' - DONE \r\nBoxplot static image is on onedrive. Variable name in table will link to boxplot. - DONE \r\nRead about box plot ideas on one drive. Use what is there to populate content of /boxplot page. Update query choice from second tab of lookup on one drive -- and tab three - DONE \r\nReview onedrive copy of \'websitetextdoc.docx\' for upated verbiage. - DONE \r\n\r\n--last Lowest Priority\r\n[ ]   Replace \"Density Maps\" \"Boxplot\" - with figure titles\r\n[ ]   Front page & Explore page: remove \"Sample Density Maps\" & \"Timeline   Comparison\"\r\n[ ]   Breadcrumbs\r\n[ ] Work with David to record a video of the demo. This will be used as a backup just in case the website is not available. This to be done On or about Monday morning after we stop development.\r\n[X] Stacked timeline \r\n[ ]  Side-by-side maps - compare function \r\n[ ]  Add \'multiple scenario\' feature to user experience including additional vertical lines on timeline and extra columns in table to show toe range for different scenarios. \r\n[ ]  Add popup from tab 3 of file on onedrive. . \r\n[ ]  Mouseover image on form. \r\n[ ]  Heat Map (on new page) (is this phase 2?)\r\n\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:10:\"plain_text\";s:10:\"safe_value\";s:8845:\"<p>Please mark with &#039;DONE&#039; as appropriate. Bold items are highest priority. </p>\n<p>David<br />\n[ ] Spin up a second dev environment. Then send the URL and DB credentials to the team members who need them.<br />\n[ ] Experiment with larger fonts in form controls. Constraint will be that larger fonts might affect layout. The &#039;colourize&#039; theme has settings for content width which might help gain more screen space.<br />\n [X] Shrink pages to reduce scrolling. Ideas might include squeeze header im