n appears after choice is made with first. - DONE<br />\non &#039;compare&#039; all three disabled get &#039;all&#039; option. That option is preselected. - DONE<br />\nMove these three into three columns. - DONE<br />\n&#039;Selection of variables available.&#039; micht be test with variable. - What does this mean? I wrote this yet I cannot decipher it. - IGNORE<br />\nHide three disabled on timeline - DONE<br />\nRemove lower copy of three var text. - DONE<br />\nin &#039;TOE range&#039; column: if year is over 2100 change to &#039;beyond 2100&#039; - DONE<br />\nFix display of V8 and other: degree symbol instead of &#039;deg&#039;. - DONE<br />\n&#039;dataset&#039; is not GCM, but look again at website text for &#039;BCSD&#039;. - DONE<br />\non timeline page circle around king county graphic. Must be visual. - DONE<br />\nget a &#039;boxplots&#039; page up. - DONE<br />\nCan we add fieldset/border around form choices? YES, but the theme supresses fieldset borders. Moving border work to Anika. - DONE<br />\n--more move all to top of list. - DONE<br />\nMake variable box bigger. Label it as &#039;Hydroclimatic Variables&#039; - DONE<br />\nBoxplot static image is on onedrive. Variable name in table will link to boxplot. - DONE<br />\nRead about box plot ideas on one drive. Use what is there to populate content of /boxplot page. Update query choice from second tab of lookup on one drive -- and tab three - DONE<br />\nReview onedrive copy of &#039;websitetextdoc.docx&#039; for upated verbiage. - DONE </p>\n<p>--last Lowest Priority<br />\n[ ]   Replace &quot;Density Maps&quot; &quot;Boxplot&quot; - with figure titles<br />\n[ ]   Front page &amp; Explore page: remove &quot;Sample Density Maps&quot; &amp; &quot;Timeline   Comparison&quot;<br />\n[ ]   Breadcrumbs<br />\n[ ] Work with David to record a video of the demo. This will be used as a backup just in case the website is not available. This to be done On or about Monday morning after we stop development.<br />\n[X] Stacked timeline<br />\n[ ]  Side-by-side maps - compare function<br />\n[ ]  Add &#039;multiple scenario&#039; feature to user experience including additional vertical lines on timeline and extra columns in table to show toe range for different scenarios.<br />\n[ ]  Add popup from tab 3 of file on onedrive. .<br />\n[ ]  Mouseover image on form.<br />\n[ ]  Heat Map (on new page) (is this phase 2?)</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1407527180,1),('field:node:6','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2334:\"<h2>Multi-Model Projections of Time of Emergence for {Number of days per year with daily maximum temperature exceeding 90°F (32.2°C)}</h2>\r\n\r\n<p>Region: {King County} Tolerance: {Low (middle 90% historical fluctuations)} Dataset: {Statistically-downscaled (CMIP5 BCSD)}</p>\r\n\r\n<p><img src=\"/sites/all/modules/toewhiskers/images/boxplot2.png\" /> This figure illustrates the effects of uncertainties associated with:</p>\r\n\r\n<ul>\r\n	<li>The methodology used to estimate time of emergence – represented by the three boxplots in each sub-plot</li>\r\n	<li>Climate modeling due to the use of different global climate models – represented by the horizontal spread of dots</li>\r\n	<li>Future emissions – represented by the left and right panels</li>\r\n	<li>The user’s tolerance based on the historical hydro-climatic fluctuations – represented by the top and bottom panels</li>\r\n</ul>\r\n\r\n<p>In each sub-plot:</p>\r\n\r\n<ul>\r\n	<li>The top row shows the spread of multi-model projections for the lower bound (i.e. earlier) time of emergence estimates; the bottom row shows the multi-model spread for the upper bound (i.e. later) estimates.</li>\r\n	<li>The middle row shows the central tendency of the time of emergence estimate.</li>\r\n</ul>\r\n\r\n<p>Learn more [Hide text below]</p>\r\n\r\n<h3>Time of emergence estimation uncertainty</h3>\r\n\r\n<p>Because only one realization of modeling outcome from each global climate model has been used in this analysis, using different realizations from the same global climate model could lead to different estimates of the climate change signal, and therefore different time of emergence.</p>\r\n\r\n<p>This error is represented by the lower and upper bound estimates of the time of emergence based on the 5% and 95th confidence intervals, respectively. i.e., For each global climate model, we are 90% confident that the true time of emergence is estimated to occur between the lower and upper bound values that denote the earliest and latest time of emergence, respectively.</p>\r\n\r\n<h3>Climate modeling uncertainty</h3>\r\n\r\n<p>For each confidence interval (i.e. each boxplot):</p>\r\n\r\n<ul>\r\n	<li>Each dot represents the time of emergence projected by each of the global climate model used in the analysis.</li>\r\n	<li>The box indicates the 25th and 75th percentile of the multi-model projected range.</li>\r\n</ul>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:2272:\"<h2>Multi-Model Projections of Time of Emergence for {Number of days per year with daily maximum temperature exceeding 90°F (32.2°C)}</h2>\n<p>Region: {King County} Tolerance: {Low (middle 90% historical fluctuations)} Dataset: {Statistically-downscaled (CMIP5 BCSD)}</p>\n<p><img src=\"/sites/all/modules/toewhiskers/images/boxplot2.png\" /> This figure illustrates the effects of uncertainties associated with:</p>\n<ul><li>The methodology used to estimate time of emergence – represented by the three boxplots in each sub-plot</li>\n<li>Climate modeling due to the use of different global climate models – represented by the horizontal spread of dots</li>\n<li>Future emissions – represented by the left and right panels</li>\n<li>The user’s tolerance based on the historical hydro-climatic fluctuations – represented by the top and bottom panels</li>\n</ul><p>In each sub-plot:</p>\n<ul><li>The top row shows the spread of multi-model projections for the lower bound (i.e. earlier) time of emergence estimates; the bottom row shows the multi-model spread for the upper bound (i.e. later) estimates.</li>\n<li>The middle row shows the central tendency of the time of emergence estimate.</li>\n</ul><p>Learn more [Hide text below]</p>\n<h3>Time of emergence estimation uncertainty</h3>\n<p>Because only one realization of modeling outcome from each global climate model has been used in this analysis, using different realizations from the same global climate model could lead to different estimates of the climate change signal, and therefore different time of emergence.</p>\n<p>This error is represented by the lower and upper bound estimates of the time of emergence based on the 5% and 95th confidence intervals, respectively. i.e., For each global climate model, we are 90% confident that the true time of emergence is estimated to occur between the lower and upper bound values that denote the earliest and latest time of emergence, respectively.</p>\n<h3>Climate modeling uncertainty</h3>\n<p>For each confidence interval (i.e. each boxplot):</p>\n<ul><li>Each dot represents the time of emergence projected by each of the global climate model used in the analysis.</li>\n<li>The box indicates the 25th and 75th percentile of the multi-model projected range.</li>\n</ul>\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1407527096,1),('field:node:7','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:64:\"<h2>Climate Change Response Action: {County} Priority Map</h2>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:63:\"<h2>Climate Change Response Action: {County} Priority Map</h2>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1407526726,1),('field:node:8','a:3:{s:4:\"body\";a:0:{}s:11:\"field_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"29\";s:3:\"uid\";s:1:\"5\";s:8:\"filename\";s:34:\"ToE-RandomCounties_PugetSound0.png\";s:3:\"uri\";s:45:\"public://ToE-RandomCounties_PugetSound0