INSERT INTO `cache_filter` VALUES ('filtered_html::9cd686a695a4ad0f11c6195601decf498541d7c1254e9ea78d10e9d86537f98c','<p>This map provides an indication of the priority areas in the Pacific Northwest based on the selected hydro-climatic variables for different decades. The darker the shading, the higher the fraction of selected hydro-climatic variables showing emergence of the climate change signal (i.e. noticeable effects of climate change) by a particular decade.</p>\n<p>View the <a href=\"/timeline\">Timeline visualization</a> for this set of variables and parameters.</p>\n',0,1407526833,0),('filtered_html::f73bb2ee74fa943fc6bfc385a293f681acc785edc5ff952a7593a1889a796c70','<p>This map provides an indication of the priority areas in the Pacific Northwest based on the selected hydro-climatic variables for different decades. The darker the shading, the higher the fraction of selected hydro-climatic variables showing emergence of the climate change signal (i.e. noticeable effects of climate change) by a particular decade.</p>\n',0,1407526726,0),('full_html::0439905a5c6aed366add2a00e9afa57684ffca3586875d22c14001dec82f133f','<div class=\"graphics-uwt_w_and_wordmark_horiz_white\"></div>\n',0,1407526655,0),('full_html::610c35ce19ab75f358432d6ee59584307ae486c4040d336d1d80c5ce7016e2af','<p> </p>\n',0,1407526655,0);
