INSERT INTO `field_data_body` VALUES ('node','page',0,1,8,'und',0,'<div>\r\n<div>\r\n<div>\r\n<div>\r\n<h2><a href=\"/explore\">EXPLORE</a></h2>\r\n</div>\r\nCreate my own customized maps and charts.</div>\r\n</div>\r\n\r\n<div>\r\n<div>\r\n<div>\r\n<h2><a href=\"\">READ</a></h2>\r\n</div>\r\nWhat is “time of emergence”?</div>\r\n</div>\r\n\r\n<div>\r\n<div>\r\n<div>\r\n<h2><a href=\"\">TOUR</a></h2>\r\n</div>\r\nView different ways to create customized climate change information.</div>\r\n</div>\r\n</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div><img id=\"epa-logo\" src=\"sites/all/themes/uwtv6zen/images/toe/epa_logo_vert_small.gif\" style=\"background-color:rgb(255, 255, 255); display:inline\" /><img id=\"usace-logo\" src=\"sites/all/themes/uwtv6zen/images/toe/uwtoe_acoe_usace_logos.png\" style=\"background-color:#FFFFFF; display:inline\" /><img id=\"cig-logo\" src=\"sites/all/themes/uwtv6zen/images/toe/CIG_logo_color_3_inch.jpg\" style=\"background-color:#FFFFFF; display:inline\" /></div>\r\n\r\n<p>&nbsp;</p>\r\n','','full_html'),('node','page',0,2,2,'und',0,'<p>First select a region:</p>\r\n<p><img src=\"sites/default/files/wamap.png\"></p>\r\n<p>Then select the visiualization:<br/>\r\n<a href=\"compare\">Compare multiple hydroclimatic variables in a single geographic domain</a><br/>\r\n<a href=\"\"  style=\"pointer-events: none; cursor: default;\">Explore the spatial variability of one hydro-climatic variable across a specific geographic domain</a></p>\r\n','','full_html'),('node','page',0,3,3,'und',0,'<!--<p>\r\nHydroclimatic variables will be show for region: <strong>King County</strong><br/>\r\nVisualization tool: <strong>Compare multiple hydroclimatic variables in a single geographic domain</strong>\r\n\r\nPlease refine query by choosing from options below. All fields are required.\r\n</p>-->\r\n<p>Define parameters for visualization.</p>','','full_html'),('node','webform',0,4,4,'und',0,'Webform one','','filtered_html'),('node','page',0,5,5,'und',0,'Please mark with \'DONE\' as appropriate. Bold items are highest priority. \r\n\r\nDavid \r\n[ ] Spin up a second dev environment. Then send the URL and DB credentials to the team members who need them.\r\n[ ] Experiment with larger fonts in form controls. Constraint will be that larger fonts might affect layout. The \'colourize\' theme has settings for content width which might help gain more screen space.\r\n [X] Shrink pages to reduce scrolling. Ideas might include squeeze header image and/or shrink text in header. \r\n\r\nAnika\r\n[ ]    - Tick marks on timeline - show tick marks for 5 years (not 1 year), no  need to display \"2005\", \"2015\", \"2025\"..\r\n[ ] Create d3.js code that can create dynamic \'boxplot\' images. Please format your code so that we can easily integrate dynamic values in the future. Please develop it outside the existing toe codebase so that any bugs do not affect the functioning demo. You can use the boxplot images to get an idea of what needs to be drawn for each boxplot image. Ask David  for more detail as necessary.\r\n[X] <strong>On timeline change tick marks to 5 year</strong>\r\n[X] Timeline: colored circles -- green seems to be most visible against the black background\r\n[X] Add map thumbnail for King County*,\r\n[X] Add a Slideshow to the images on /density-maps. Navigation buttons to allow users to move from image to image are required. \r\n[  ] Display text for each image. Rita will supply proper text for each image.\r\n[X] Color the circles on the timeline. Something like Violet. \r\n[X] Add Density Maps page \r\n[X] Add option on explore page for \"View the priority areas for climate change response action\" \r\n[X] Link ^ option to go to /density-maps after variable selection instead of timeline \r\n[X] Fix positioning of tolerance and confidence form items on /compare page \r\n[  ] Timeline must look prettier - colors/time widths etc. Check with Abdeltawab for additional feedback as necessary. \r\n[X] Variable shortname stacked if timeline same TOE.\r\n[X] In the timeline, alter the variable shortname so that is a link to the path \'/boxplot\'. \r\n[?] Add a header to the theme.!!\r\n[X] Fill color on empty choropleth map regions doesn\'t match background \r\n[  ] Tooltip not working on timeline in Chrome. \r\n[X] Center/shrink county names on WA map on \'explore\' page - DONE \r\n[X] Change read,tour,explore into three columns. Bigger text for these three items. Shrink acknowledgements/disclaimer text. - DONE \r\n[X] Remove \'Partner\'s\' word. - DONE \r\n[X] One logo missing. Two similar USACE logos(need both). - DONE\r\n[X] Add slightly different background color to \'title\' text like \'Explore\' on the \'/explore\'\' page. (silver or greay) explore/compare/ title. - DONE\r\n[X] Front page logos evenly spaced horizontally. - DONE\r\n[X] The form on the \'/compare\' page has two \'fieldsets\'. Please alter .css so those fieldsets have one pixel borders using a color that matches the theme. - DONE\r\n[X] Remove commas from numeric \'year\' along x axis. - DONE \r\n\r\nDwaine \r\n[X ] - Remove the right Army Corps logo “Climate Change Adaptation Steering  Committee\r\n[X ]    Update boxplot image.\r\n[ ] Update Puget Sound & PNW density maps - the order *does*    matter, label as \"Puget Sound / Pacific NW 2010, ..., 2100\"     [OneDrive/Static images/New maps]\r\n[ ] - Stacked timeline: show results for 3 different confidence, all for    RCP8.5\r\n [ ]   - Update all titles/sub-titles of maps/table/boxplot/query choices   [OneDrive/Draft ToE Results/TestVariablesLookupScen1_RY.xlsx &    WebsiteText.doc]\r\n[X]    - Create a link from density maps to timeline\r\n[ ]    - Update map on Explore - pending satellite maps [Rita]\r\n[ ]    - Update ToE results file [OneDrive/Draft ToE Results/DemoResults.xls]:  For TOE= 0:\r\n  + Not display on timeline but show variable in table\r\n  + In the Table, \"TOE Range\" reads \"GCMs disagree\"\r\n  For ChangeDir=0: In the Table, \"Direction of Change\" reads \"N/A\"\r\n [ ] Create PNW and Puget Sound blank maps ?? David replied with: <em>CIG will provide the maps.We just need to drop them in were the current d3 map is</em>\r\n [X] Homepage: - *Remove \"Welcome to ToE\"*\r\n [X] Homepage: *Put EXPLORE (1st), READ (2nd), TOUR (3rd) in 3 large equal-sized boxes*\r\n [X] Homepage: Smaller \"ToE Future changes...\" &amp; effects\r\n [X] Homepage: Hide text of Acknowledgement &amp; Disclaimer\r\n [X] Homepage: Tabs along the top: (1) change \"Welcome\" to \"Home\", (2) EXPLORE (1st), READ (2nd), TOUR (3rd)\r\n [X] Create \'*stacked timelines\' on webpage/worksheet (could be static image)*,\r\n [X] - David seems to have done this already. *No scrolling - most/all of the timeline, boxplot, density maps needs to be showing without scrolling*\r\n [X] PNW and* Puget Sound density maps* - slider [2x10 maps] - PNW maps are up. Puget Sound Maps need \'Nivo Slider Views\' module.\r\n [X] Preselect \'King County\' [X] Confidence band upper and lower are switched. Fix as necessary.\r\n [X] Third \'I want option\' can go straight to \'compare\' page. \r\n [X] Add links for \'timeline-comparison\' and \'density-maps\' to footer region.\r\n [X] Add functionality to route third \'I want to\' option to the /density-maps page.\r\n [X] Enable FCKeditor\r\n [X] Create dummy stacked timeline page\r\n [X] Bigger \'read\',tour, explore text. and in three equal columns. And maybe over the rainbow image Dwaine to respond to Rita about multiple emission scenarios. Email sent with more questions. -DONE \r\nRestore map to explore page (even if not yet cleaned up) - DONE \r\nChange submit button text (make appropriate for each page?) - DONE \r\nAdd instruction text to variables (press control for multiple....) - DONE \r\nGeographic domain can only select county, which then pops up the \'county\' dropdown. - DONE \r\nCompare/explore is first. Maybe selecting un-disables next option. Maybe next option appears after choice is made with first. - DONE \r\non \'compare\' all three disabled get \'all\' option. That option is preselected. - DONE\r\nMove these three into three columns. - DONE \r\n\'Selection of variables available.\' micht be test with variable. - What does this mean? I wrote this yet I cannot decipher it. - IGNORE \r\nHide three disabled on timeline - DONE \r\nRemove lower copy of three var text. - DONE \r\nin \'TOE range\' column: if year is over 2100 change to \'beyond 2100\' - DONE \r\nFix display of V8 and other: degree symbol instead of \'deg\'. - DONE \r\n\'dataset\' is not GCM, but look again at website text for \'BCSD\'. - DONE \r\non timeline page circle around king county graphic. Must be visual. - DONE\r\nget a \'boxplots\' page up. - DONE \r\nCan we add fieldset/border around form choices? YES, but the theme supresses fieldset borders. Moving border work to Anika. - DONE \r\n--more move all to top of list. - DONE \r\nMake variable box bigger. Label it as \'Hydroclimatic Variables\' - DONE \r\nBoxplot static image is on onedrive. Variable name in table will link to boxplot. - DONE \r\nRead about box plot ideas on one drive. Use what is there to populate content of /boxplot page. Update query choice from second tab of lookup on one drive -- and tab three - DONE \r\nReview onedrive copy of \'websitetextdoc.docx\' for upated verbiage. - DONE \r\n\r\n--last Lowest Priority\r\n[ ]   Replace \"Density Maps\" \"Boxplot\" - with figure titles\r\n[ ]   Front page & Explore page: remove \"Sample Density Maps\" & \"Timeline   Comparison\"\r\n[ ]   Breadcrumbs\r\n[ ] Work with David to record a video of the demo. This will be used as a backup just in case the website is not available. This to be done On or about Monday morning after we stop development.\r\n[X] Stacked timeline \r\n[ ]  Side-by-side maps - compare function \r\n[ ]  Add \'multiple scenario\' feature to user experience including additional vertical lines on timeline and extra columns in table to show toe range for different scenarios. \r\n[ ]  Add popup from tab 3 of file on onedrive. . \r\n[ ]  Mouseover image on form. \r\n[ ]  Heat Map (on new page) (is this phase 2?)\r\n\r\n','','plain_text'),('node','page',0,6,6,'und',0,'<h2>Multi-Model Projections of Time of Emergence for {Number of days per year with daily maximum temperature exceeding 90°F (32.2°C)}</h2>\r\n\r\n<p>Region: {King County} Tolerance: {Low (middle 90% historical fluctuations)} Dataset: {Statistically-downscaled (CMIP5 BCSD)}</p>\r\n\r\n<p><img src=\"/sites/all/modules/toewhiskers/images/boxplot2.png\" /> This figure illustrates the effects of uncertainties associated with:</p>\r\n\r\n<ul>\r\n	<li>The methodology used to estimate time of emergence – represented by the three boxplots in each sub-plot</li>\r\n	<li>Climate modeling due to the use of different global climate models – represented by the horizontal spread of dots</li>\r\n	<li>Future emissions – represented by the left and right panels</li>\r\n	<li>The user’s tolerance based on the historical hydro-climatic fluctuations – represented by the top and bottom panels</li>\r\n</ul>\r\n\r\n<p>In each sub-plot:</p>\r\n\r\n<ul>\r\n	<li>The top row shows the spread of multi-model projections for the lower bound (i.e. earlier) time of emergence estimates; the bottom row shows the multi-model spread for the upper bound (i.e. later) estimates.</li>\r\n	<li>The middle row shows the central tendency of the time of emergence estimate.</li>\r\n</ul>\r\n\r\n<p>Learn more [Hide text below]</p>\r\n\r\n<h3>Time of emergence estimation uncertainty</h3>\r\n\r\n<p>Because only one realization of modeling outcome from each global climate model has been used in this analysis, using different realizations from the same global climate model could lead to different estimates of the climate change signal, and therefore different time of emergence.</p>\r\n\r\n<p>This error is represented by the lower and upper bound estimates of the time of emergence based on the 5% and 95th confidence intervals, respectively. i.e., For each global climate model, we are 90% confident that the true time of emergence is estimated to occur between the lower and upper bound values that denote the earliest and latest time of emergence, respectively.</p>\r\n\r\n<h3>Climate modeling uncertainty</h3>\r\n\r\n<p>For each confidence interval (i.e. each boxplot):</p>\r\n\r\n<ul>\r\n	<li>Each dot represents the time of emergence projected by each of the global climate model used in the analysis.</li>\r\n	<li>The box indicates the 25th and 75th percentile of the multi-model projected range.</li>\r\n</ul>\r\n','','full_html'),('node','page',0,7,7,'und',0,'<h2>Climate Change Response Action: {County} Priority Map</h2>\r\n','','full_html'),('node','page',0,11,12,'und',0,'<p>Timeline Comparison allows a user to see different visualizations on the same screen. First a set of hydroclimatic variables and parameters is chosen by the user. Then the emission scenarios and/or parameters can be altered with subsequent queries to the database. The resultant visualizations are then shown together for comparison.</p>\r\n\r\n<p><img alt=\"\" src=\"/sites/all/modules/toewhiskers/images/stacked.png\" /></p>\r\n','','full_html');
/*!40000 ALTER TABLE `field_data_body` ENABLE KEYS */;
UNLOCK TABLES;

